import "./Categories.css";

import React from "react";
import NavBar from "./NavBar";

function Categories(){
    return (
        <>
        <NavBar title="Select your categories" />

        <div id="cardsWrapper">
            <div id="cards">
                <div class="card" id="card1">

                </div>
            </div>
        </div>
        </>
    );
}

export default Categories;
